import React from "react";
import { Link } from "react-router-dom";
import "./style.css";

const skills = [
    { name: 'React' },
    { name: 'JavaScript' },
    { name: 'HTML' },
    { name: 'CSS' }
  ];

  const colors = ['#0088FE', '#00C49F', '#FFBB28', '#FF8042'];

  class Skills extends React.Component {
    render() {
      return (
        <div>
          {skills.map((a, i) => <div class="box"><p style={{ color: colors[i] }} key={i}>{a.name}</p></div>)}
        </div>
      );
    }
  }


